/*
 * type: custom:sip-doorbell
 * server:
 *   sip:
 *     url: wss://sip.domain.tld:8443/ws
 *     username: 001@sip.domain.tld
 *     credential: secret
 *   ice:
 *     - urls: stun:sip.domain.tld
 *     - urls: turn:sip.domain.tld
 *       username: 001@sip.domain.tld
 *       credential: secret
 * access:
 *   - key: 1#
 *     icon: mdi:door
 *   - key: 2#
 *     icon: mdi:gate
 * camera: camera.doorbell
 * remote: 999@sip.domain.tld
 */

import '/local/vendor/jssip.js';

window.customCards = window.customCards || [];
window.customCards.push({
  type:'sip-doorbell',
  name:'SIP Doorbell',
  description:'The SIP Doorbell card allows you to integrate your intercom unit.'
});

class sipDoorbell extends HTMLElement {
  constructor() {
    super();
    this.attachShadow({mode:'open'});
    window.sipDoorbell = window.sipDoorbell || {};

    this.version = '0.0.1';
    this.startup = {
      content:false,
      control:false
    };

    (() => {
      let child = new MutationObserver((m) => {
        m.forEach((l) => {
          l.addedNodes.forEach((e) => {
            if(e.nodeName === 'HA-CARD') {
              focus.observe(e);
            }
          });
        });
      });

      let focus = new IntersectionObserver((i) => {
        i.forEach((e) => {
          if(e.isIntersecting) {
            this.stretch();
          }
        });
      }, {
        root:this.shadowRoot.activeElement
      });

      child.observe(this.shadowRoot, {
        attributes:false,
        childList:true,
        subtree:false
      });

      window.addEventListener('resize', () => this.stretch());
      window.addEventListener('orientationchange', () => this.stretch());
    })();
  }

  getCardSize() {
    return 1;
  }

  setConfig(config) {
    const assets = {
      poster:{
        canvas:'#080d2a',
        source:'data:image/png;base64,'
      },
      notice:{
        callup:'data:audio/mp3;base64,',
        pickup:'data:audio/mp3;base64,'
      }
    };

    this.config = {
      assets:{
        poster:{
          canvas:config.assets?.poster?.canvas ? config.assets?.poster?.canvas : assets.poster.canvas,
          source:config.assets?.poster?.source ? config.assets?.poster?.source : assets.poster.source
        },
        notice:{
          callup:new Audio(config.assets?.notice?.callup ? config.assets?.notice?.callup : assets.notice.callup),
          pickup:new Audio(config.assets?.notice?.pickup ? config.assets?.notice?.pickup : assets.notice.pickup)
        }
      },
      server:{
        sip:config.server?.sip ? config.server?.sip : {},
        opt:{
          mediaConstraints:{
            audio:true,
            video:true
          },
          pcConfig:{
            iceServers:config.server?.ice ? config.server?.ice : []
          }
        }
      },
      access:config.access ? config.access : [],
      camera:{
        entity:config.camera ? config.camera : '',
        secret:''
      },
      remote:config.remote ? config.remote : ''
    };

    crypto.subtle.digest('SHA-1', new TextEncoder().encode(JSON.stringify(this.config.server.sip))).then((b) => {
      this.config.worker = Array.from(new Uint8Array(b)).map((d) => d.toString(16).padStart(2, '0')).join('');

      if(this.startup.content === false) {
        this.startup.content = true;
        this.content();
      }

      if(this.startup.control === false) {
        this.startup.control = true;
        this.control();
      }
    });
  }

  set hass(hass) {
    if(this.config.camera.entity) {
      this.config.camera.secret = hass.states[this.config.camera.entity].attributes['access_token'];
    }
  }

  content() {
    this.shadowRoot.innerHTML = `
      <style>
        ha-card {
          min-width: 320px;
          min-height: 240px;

          width: 100%;
          height: 100%;
          background: ${this.config.assets.poster.canvas};

          display: flex;
          align-items: center;
          justify-content: center;
        }

        ha-icon {
          margin: 30px;
          padding: 15px;
          cursor: pointer;

          border-width: 2px;
          border-radius: 50%;
          border-style: solid;

          color: white;
          --mdc-icon-size: 30px;

          transition: all 0.25s;
          box-shadow: 0 5px 10px rgba(0, 0, 0, 0.5);
        }

        ha-icon:hover {
          transform: scale(1.05);
          box-shadow: 0 15px 25px rgba(0, 0, 0, 0.5);
        }

        ha-icon:active {
          transform: scale(0.95);
          box-shadow: 0 4px 8px rgba(0, 0, 0, 0.5);
        }

        #field {
          width: 0;
          height: 0;
          position: relative;
        }

        #panel {
          left: 0;
          right: 0;
          bottom: 0;
          position: absolute;
        }

        #panel span {
          display: flex;
          align-items: center;
          justify-content: center;
        }

        #video {
          width: 100%;
          height: 100%;
          display: none;
          object-fit: contain;
        }

        #image {
          width: 100%;
          height: 100%;
          display: block;
          object-fit: contain;
        }

        [data-key="callup"] {
          display: ${this.config.remote ? 'initial' : 'none'};
          background: green;
        }

        [data-key="pickup"] {
          display: none;
          background: green;
        }

        [data-key="hangup"] {
          display: none;
          background: red;
        }

        ${this.config.access.map((d) => `[data-key="${d.key}"] {display: none; background: green;}`).join('')}
      </style>

      <ha-card>
        <div id="field">
          <audio id="audio" autoplay playsinline></audio>
          <video id="video" autoplay playsinline></video>
          <img id="image">
          <div id="panel">
            <span>
              ${this.config.access.map((d) => `<ha-icon data-key="${d.key}" icon="${d.icon}"></ha-icon>`).join('')}
              <ha-icon data-key="callup" icon="mdi:phone-classic"></ha-icon>
              <ha-icon data-key="pickup" icon="mdi:phone"></ha-icon>
              <ha-icon data-key="hangup" icon="mdi:phone-hangup"></ha-icon>
            </span>
          </div>
        </div>
      </ha-card>
    `;
  }

  control() {
    if(window.sipDoorbell[this.config.worker]) {
      window.sipDoorbell[this.config.worker].stop();
    }

    window.sipDoorbell[this.config.worker] = new JsSIP.UA({
      sockets:new JsSIP.WebSocketInterface(this.config.server.sip.url),
      uri:'sip:' + this.config.server.sip.username,
      password:this.config.server.sip.credential
    });

    if(window.sipDoorbell[this.config.worker]) {
      window.sipDoorbell[this.config.worker].on('newRTCSession', (rtc) => {
        let stream = {
          audio:this.element('#audio'),
          video:this.element('#video'),
          image:this.element('#image')
        };

        if(rtc.session.direction === 'incoming') {
          console.info('%cIncoming call:' + ' ' + rtc.session.remote_identity, 'color: blue;');
          this.caution('notice-pickup-play');
          this.incoming_call_accepted = false;

          this.element('[data-key="callup"]').setAttribute('style', 'display: none;');
          this.element('[data-key="pickup"]').setAttribute('style', 'display: initial;');
          this.element('[data-key="hangup"]').setAttribute('style', 'display: initial;');
          this.config.access.forEach((d) => this.element('[data-key="' + d.key + '"]').setAttribute('style', 'display: none;'));

          rtc.session.on('accepted', () => {
            if(this.incoming_call_accepted !== null) {
              console.info('%cIncoming call accepted', 'color: yellow;');
              this.caution('notice-pickup-stop');
              this.incoming_call_accepted = true;

              this.element('[data-key="callup"]').setAttribute('style', 'display: none;');
              this.element('[data-key="pickup"]').setAttribute('style', 'display: none;');
              this.element('[data-key="hangup"]').setAttribute('style', 'display: initial;');
              this.config.access.forEach((d) => this.element('[data-key="' + d.key + '"]').setAttribute('style', 'display: initial;'));

              if(this.config.camera.entity) {
                stream.image.src = '/api/camera_proxy_stream/' + this.config.camera.entity + '?token=' + this.config.camera.secret;

                stream.video.setAttribute('style', 'display: none;');
                stream.image.setAttribute('style', 'display: block;');
              } else {
                stream.video.setAttribute('style', 'display: block;');
                stream.image.setAttribute('style', 'display: none;');
              }

              this.element('ha-card').setAttribute('style', 'background: var(--ha-card-background, var(--card-background-color, white));');
            }
          });

          rtc.session.on('failed', (e) => {
            console.info('%cIncoming call failed:' + ' ' + e.cause, 'color: red;');
            this.caution('notice-pickup-stop');
            this.cleanup();
          });

          rtc.session.on('ended', (e) => {
            console.info('%cIncoming call ended:' + ' ' + e.cause, 'color: red;');
            this.caution('notice-pickup-stop');
            this.cleanup();
          });

          rtc.session.on('peerconnection', () => {
            rtc.session.connection.ontrack = (e) => {
              switch(e.track.kind) {
                case 'audio': {
                  stream.audio.srcObject = e.streams[0];
                  break;
                }
                case 'video': {
                  stream.video.srcObject = e.streams[0];
                  break;
                }
              }
            };
          });

          this.element('[data-key="pickup"]').addEventListener('click', () => {
            rtc.session.answer(this.config.server.opt);
          });

          this.element('[data-key="hangup"]').addEventListener('click', () => {
            if(this.incoming_call_accepted) {
              rtc.session.terminate();
            } else {
              this.incoming_call_accepted = null;

              rtc.session.on('accepted', () => {
                rtc.session.terminate();
              });

              rtc.session.answer(this.config.server.opt);
            }
          });

          this.config.access.forEach((d) => {
            this.element('[data-key="' + d.key + '"]').addEventListener('click', () => {
              rtc.session.sendDTMF(d.key, {
                duration:250,
                interToneGap:500
              });
            });
          });
        }

        if(rtc.session.direction === 'outgoing') {
          console.info('%cOutgoing call:' + ' ' + rtc.session.remote_identity, 'color: blue;');
          this.caution('notice-callup-play');
          this.outgoing_call_confirmed = false;

          this.element('[data-key="callup"]').setAttribute('style', 'display: none;');
          this.element('[data-key="pickup"]').setAttribute('style', 'display: none;');
          this.element('[data-key="hangup"]').setAttribute('style', 'display: initial;');
          this.config.access.forEach((d) => this.element('[data-key="' + d.key + '"]').setAttribute('style', 'display: none;'));

          rtc.session.on('confirmed', () => {
            if(this.outgoing_call_confirmed !== null) {
              console.info('%cOutgoing call confirmed', 'color: yellow;');
              this.caution('notice-callup-stop');
              this.outgoing_call_confirmed = true;

              this.element('[data-key="callup"]').setAttribute('style', 'display: none;');
              this.element('[data-key="pickup"]').setAttribute('style', 'display: none;');
              this.element('[data-key="hangup"]').setAttribute('style', 'display: initial;');
              this.config.access.forEach((d) => this.element('[data-key="' + d.key + '"]').setAttribute('style', 'display: initial;'));

              if(this.config.camera.entity) {
                stream.image.src = '/api/camera_proxy_stream/' + this.config.camera.entity + '?token=' + this.config.camera.secret;

                stream.video.setAttribute('style', 'display: none;');
                stream.image.setAttribute('style', 'display: block;');
              } else {
                stream.video.setAttribute('style', 'display: block;');
                stream.image.setAttribute('style', 'display: none;');
              }

              this.element('ha-card').setAttribute('style', 'background: var(--ha-card-background, var(--card-background-color, white));');
            }
          });

          rtc.session.on('failed', (e) => {
            console.info('%cOutgoing call failed:' + ' ' + e.cause, 'color: red;');
            this.caution('notice-callup-stop');
            this.cleanup();
          });

          rtc.session.on('ended', (e) => {
            console.info('%cOutgoing call ended:' + ' ' + e.cause, 'color: red;');
            this.caution('notice-callup-stop');
            this.cleanup();
          });

          rtc.session.connection.ontrack = (e) => {
            switch(e.track.kind) {
              case 'audio': {
                stream.audio.srcObject = e.streams[0];
                break;
              }
              case 'video': {
                stream.video.srcObject = e.streams[0];
                break;
              }
            }
          };

          this.element('[data-key="hangup"]').addEventListener('click', () => {
            rtc.session.terminate();
          });

          this.config.access.forEach((d) => {
            this.element('[data-key="' + d.key + '"]').addEventListener('click', () => {
              rtc.session.sendDTMF(d.key, {
                duration:250,
                interToneGap:500
              });
            });
          });
        }
      });

      window.sipDoorbell[this.config.worker].on('registered', () => {
        console.info('%cSIP-DOORBELL ' + this.version + ' IS INSTALLED', 'color: green; font-weight: bold;');
      });

      window.sipDoorbell[this.config.worker].on('unregistered', () => {
        console.info('%cSIP-DOORBELL ' + this.version + ' IS UNINSTALLED', 'color: yellow; font-weight: bold;');
      });

      window.sipDoorbell[this.config.worker].on('registrationFailed', () => {
        console.info('%cSIP-DOORBELL ' + this.version + ' INSTALLATION FAILED', 'color: red; font-weight: bold;');
      });

      window.sipDoorbell[this.config.worker].start();
    }

    this.cleanup();
  }

  cleanup() {
    this.element('#image').src = this.config.assets.poster.source;

    this.factory('[data-key="callup"]');
    this.factory('[data-key="pickup"]');
    this.factory('[data-key="hangup"]');
    this.config.access.forEach((d) => this.factory('[data-key="' + d.key + '"]'));

    this.element('ha-card').removeAttribute('style');
    this.element('#video').removeAttribute('style');
    this.element('#image').removeAttribute('style');

    if(this.config.remote) {
      this.element('[data-key="callup"]').addEventListener('click', () => {
        window.sipDoorbell[this.config.worker].call('sip:' + this.config.remote, this.config.server.opt);
      });
    }
  }

  caution(t) {
    let play = (e) => {
      if(e.paused) {
        e.currentTime = 0;
        e.loop = true;
        e.play();
      }
    };

    let stop = (e) => {
      if(!e.paused) {
        e.pause();
      }
    };

    switch(t) {
      case 'notice-callup-play': {
        stop(this.config.assets.notice.pickup);
        play(this.config.assets.notice.callup);
        break;
      }
      case 'notice-pickup-play': {
        stop(this.config.assets.notice.callup);
        play(this.config.assets.notice.pickup);
        break;
      }
      default: {
        stop(this.config.assets.notice.callup);
        stop(this.config.assets.notice.pickup);
        break;
      }
    }
  }

  element(e) {
    return this.shadowRoot.querySelector(e);
  }

  factory(e) {
    let o = this.element(e);
    let n = o.cloneNode(true);

    n.removeAttribute('style');
    o.parentNode.replaceChild(n, o);
  }

  stretch() {
    try {
      let s = this.element('ha-card');
      let e = this.element('#field');
      let d = s.getBoundingClientRect();

      e.style.width = Math.max(0, (d.left > 0) ? Math.min(d.width, (window.innerWidth - d.left)) : Math.min(d.right, window.innerWidth)) + 'px';
      e.style.height = Math.max(0, (d.top > 0) ? Math.min(d.height, (window.innerHeight - d.top)) : Math.min(d.bottom, window.innerHeight)) + 'px';
    } catch(e) {
      //continue
    }
  }

  static getConfigElement() {
    return document.createElement('sip-doorbell-editor');
  }

  static getStubConfig() {
    return {
      server:{
        sip:{
          url:'wss://sip.domain.tld:8443/ws',
          username:'001@sip.domain.tld',
          credential:'secret'
        }
      }
    };
  }
}

class sipDoorbellEditor extends HTMLElement {
  setConfig(config) {
    this.config = config;

    window.sipDoorbellEditor = (k, v) => {
      eval('this.config' + '.' + k + '=' + '"' + v + '"');

      let d = new CustomEvent('config-changed', {
        bubbles:true,
        composed:true,
        detail:{
          config:this.config
        }
      });

      this.dispatchEvent(d);
    };

    this.innerHTML = `
      <paper-input label="SIP Server [url]" value="${this.config.server.sip.url}" onchange="sipDoorbellEditor('server.sip.url', this.value)"></paper-input>
      <paper-input label="SIP Server [username]" value="${this.config.server.sip.username}" onchange="sipDoorbellEditor('server.sip.username', this.value)"></paper-input>
      <paper-input label="SIP Server [credential]" value="${this.config.server.sip.credential}" onchange="sipDoorbellEditor('server.sip.credential', this.value)"></paper-input>
    `;
  }
}

customElements.define('sip-doorbell', sipDoorbell);
customElements.define('sip-doorbell-editor', sipDoorbellEditor);
